generated.css:
@import url('https://fonts.googleapis.com/css?family=Roboto+Mono');

body {
	text-align: center;
	margin: 0;
	font-family: 'Roboto Mono', Arial, sans-serif;
	font-size: 20px;
	padding: 5vh 5vw;
}

img {
	margin: 0 auto;
	width: 75vw;
}

.project {
	width: 75vw;
	display: inline-block;
	vertical-align: top;
}

.title-fade-out {
	opacity: 0;
	animation-name: fade-out;
	animation-duration: 2s;
}

.title-fade-in {
	opacity: 1;
	animation-name: fade-in;
	animation-duration: 2s;
}

@keyframes fade-out {
	from { opacity: 1 }
	to { opacity: 0 }
}

@keyframes fade-in {
	from { opacity: 0 }
	to { opacity: 1 }
}

#selfie {
	max-height: 40vh;
	width: auto;
	border-radius: 220px;
}
